const HomePage = ()=>{

    const [loadAnimation, setLoadAnimation] = useState(false)
    const [games, setgames] = useState(["Minecraft", "ARK", "Terraria", "Unturned", "Rust"])

    setTimeout(()=>{
        setLoadAnimation(true)
    }, 50)



    const ChangeGame = ()=>{
            // if(gamelist.indexOf(game)=== gamelist.length-1){
            //     changeGame()
            // }
        let i = 0
        setgames(games.indexOf(games[i]))
        i++
        let value = games[i]
        return value
    }

    return(
        <>
            <div className="homeMainContainer">
                <div className="innerContainer">
                    <span className={loadAnimation? "homeMainSpan":"homeMainSpanAway"}>Get your <span className="homeChangeGameSpan">{games}</span> server from U1Servers</span>
                </div>
            </div>
        </>
    )
}

export default HomePage
